root['/untitled_entry/untitled_sample/untitled_transformations'].attrs['EX_doc'] = '      This is the recommended location for sample goniometer       and other related axes.        This is a requirement to describe for any scan experiment.       The reason it is optional is mainly to accommodate XFEL       single shot exposures.        Use of the depends_on field and the NXtransformations group is       strongly recommended.  As noted above this should be an absolute       requirement to have for any scan experiment.        The reason it is optional is mainly to accommodate XFEL       single shot exposures.     '
root['/untitled_entry/untitled_instrument/name'].attrs['EX_doc'] = '      Name of instrument.  Consistency with the controlled       vocabulary beamline naming in       https://mmcif.wwpdb.org/dictionaries/mmcif_pdbx_v50.dic/Items/_diffrn_source.pdbx_synchrotron_beamline.html       and       https://mmcif.wwpdb.org/dictionaries/mmcif_pdbx_v50.dic/Items/_diffrn_source.type.html       is highly recommended.     '
root['/untitled_entry/untitled_instrument/time_zone'].attrs['EX_doc'] = '      ISO 8601 time_zone offset from UTC.     '
root['/untitled_entry/untitled_instrument/untitled_detector_group'].attrs['EX_doc'] = '      Optional logical grouping of detectors.        Each detector is represented as an NXdetector       with its own detector data array.  Each detector data array       may be further decomposed into array sections by use of       NXdetector_module groups.  Detectors can be grouped logically       together using NXdetector_group. Groups can be further grouped       hierarchically in a single NXdetector_group (for example, if       there are multiple detectors at an endstation or multiple       endstations at a facility).  Alternatively, multiple       NXdetector_groups can be provided.        The groups are defined hierarchically, with names given       in the group_names field, unique identifying indices given       in the field group_index, and the level in the hierarchy       given in the group_parent field.  For example if an x-ray       detector group, DET, consists of four detectors in a       rectangular array::           DTL DTR          DLL DLR        We could have::         group_names: ["DET", "DTL", "DTR", "DLL", "DLR"]         group_index: [1, 2, 3, 4, 5]         group_parent:  [-1, 1, 1, 1, 1]     '
root['/untitled_entry/untitled_instrument/untitled_detector_group/group_names'].attrs['EX_doc'] = '       An array of the names of the detectors or the names of        hierarchical groupings of detectors.      '
root['/untitled_entry/untitled_instrument/untitled_detector_group/group_index'].attrs['EX_doc'] = '       An array of unique identifiers for detectors or groupings        of detectors.         Each ID is a unique ID for the corresponding detector or group        named in the field group_names.  The IDs are positive integers        starting with 1.      '
root['/untitled_entry/untitled_instrument/untitled_detector_group/group_parent'].attrs['EX_doc'] = '       An array of the hierarchical levels of the parents of detectors        or groupings of detectors.         A top-level grouping has parent level -1.      '
root['/untitled_entry/untitled_instrument/untitled_detector'].attrs['EX_doc'] = '      Normally the detector group will have the name ``detector``.       However, in the case of multiple detectors, each detector       needs a uniquely named NXdetector.     '
root['/untitled_entry/untitled_instrument/untitled_detector/depends_on'].attrs['EX_doc'] = '       NeXus path to the detector positioner axis that most directly        supports the detector.  In the case of a single-module        detector, the detector axis chain may start here.      '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_transformations'].attrs['EX_doc'] = '       Location for axes (transformations) to do with the        detector.  In the case of a single-module detector, the        axes of the detector axis chain may be stored here.      '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_collection'].attrs['EX_doc'] = '       Suggested container for detailed non-standard detector        information like corrections applied automatically or        performance settings.      '
root['/untitled_entry/untitled_instrument/untitled_detector/data'].attrs['EX_doc'] = '       For a dimension-2 detector, the rank of the data array will be 3.        For a dimension-3 detector, the rank of the data array will be 4.        This allows for the introduction of the frame number as the        first index.      '
root['/untitled_entry/untitled_instrument/untitled_detector/description'].attrs['EX_doc'] = '       name/manufacturer/model/etc. information.      '
root['/untitled_entry/untitled_instrument/untitled_detector/time_per_channel'].attrs['EX_doc'] = '       For a time-of-flight detector this is the scaling        factor to convert from the numeric value reported to        the flight time for a given measurement.      '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module'].attrs['EX_doc'] = '       Many detectors consist of multiple smaller modules that are        operated in sync and store their data in a common dataset.        To allow consistent parsing of the experimental geometry,        this application definiton requires all detectors to        define a detector module, even if there is only one.         This group specifies the hyperslab of data in the data        array associated with the detector that contains the        data for this module.  If the module is associated with        a full data array, rather than with a hyperslab within        a larger array, then a single module should be defined,        spanning the entire array.      '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/data_origin'].attrs['EX_doc'] = '        A dimension-2 or dimension-3 field which gives the indices         of the origin of the hyperslab of data for this module in the         main area detector image in the parent NXdetector module.          The data_origin is 0-based.          The frame number dimension (nP) is omitted.  Thus the         data_origin field for a dimension-2 dataset with indices (nP, i, j)         will be an array with indices (i, j), and for a dimension-3         dataset with indices (nP, i, j, k) will be an array with indices         (i, j, k).          The :ref:`order <Design-ArrayStorageOrder>` of indices (i, j         or i, j, k) is slow to fast.       '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/data_size'].attrs['EX_doc'] = '        Two or three values for the size of the module in pixels in         each direction. Dimensionality and order of indices is the         same as for data_origin.       '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/data_stride'].attrs['EX_doc'] = '        Two or three values for the stride of the module in pixels in         each direction.  By default the stride is [1,1] or [1,1,1],         and this is the most likely case.  This optional field is         included for completeness.       '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/module_offset'].attrs['EX_doc'] = '        Offset of the module in regards to the origin of the detector in an         arbitrary direction.       '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/fast_pixel_direction'].attrs['EX_doc'] = '        Values along the direction of :ref:`fastest varying <Design-ArrayStorageOrder>`         pixel direction.  The direction itself is given through the vector         attribute.       '
root['/untitled_entry/untitled_instrument/untitled_detector/untitled_detector_module/slow_pixel_direction'].attrs['EX_doc'] = '        Values along the direction of :ref:`slowest varying <Design-ArrayStorageOrder>`         pixel direction. The direction itself is given through the vector         attribute.       '
root['/untitled_entry/untitled_instrument/untitled_detector/distance'].attrs['EX_doc'] = '       Distance from the sample to the beam center.        Normally this value is for guidance only, the proper        geometry can be found following the depends_on axis chain,        But in appropriate cases where the dectector distance        to the sample is observable independent of the axis        chain, that may take precedence over the axis chain        calculation.      '
root['/untitled_entry/untitled_instrument/untitled_detector/distance_derived'].attrs['EX_doc'] = '       Boolean to indicate if the distance is a derived, rather than        a primary observation.  If distance_derived true or is not specified,        the distance is assumed to be derived from delector axis        specifications.      '
root['/untitled_entry/untitled_instrument/untitled_detector/dead_time'].attrs['EX_doc'] = '       Detector dead time.      '
root['/untitled_entry/untitled_instrument/untitled_detector/count_time'].attrs['EX_doc'] = '       Elapsed actual counting time.      '
root['/untitled_entry/untitled_instrument/untitled_detector/beam_center_derived'].attrs['EX_doc'] = '       Boolean to indicate if the distance is a derived, rather than        a primary observation.  If true or not provided, that value of        beam_center_derived is assumed to be true.      '
root['/untitled_entry/untitled_instrument/untitled_detector/beam_center_x'].attrs['EX_doc'] = '       This is the x position where the direct beam would hit the        detector. This is a length and can be outside of the actual        detector. The length can be in physical units or pixels as        documented by the units attribute.  Normally, this should        be derived from the axis chain, but the direct specification        may take precedence if it is not a derived quantity.      '
root['/untitled_entry/untitled_instrument/untitled_detector/beam_center_y'].attrs['EX_doc'] = '       This is the y position where the direct beam would hit the        detector. This is a length and can be outside of the actual        detector. The length can be in physical units or pixels as        documented by the units attribute.  Normally, this should        be derived from the axis chain, but the direct specification        may take precedence if it is not a derived quantity.      '
root['/untitled_entry/untitled_instrument/untitled_detector/angular_calibration_applied'].attrs['EX_doc'] = '       True when the angular calibration has been applied in the        electronics, false otherwise.      '
root['/untitled_entry/untitled_instrument/untitled_detector/angular_calibration'].attrs['EX_doc'] = '       Angular calibration data.      '
root['/untitled_entry/untitled_instrument/untitled_detector/flatfield_applied'].attrs['EX_doc'] = '       True when the flat field correction has been applied in the        electronics, false otherwise.      '
root['/untitled_entry/untitled_instrument/untitled_detector/flatfield'].attrs['EX_doc'] = '       Flat field correction data.  If provided, it is recommended        that it be compressed.      '
root['/untitled_entry/untitled_instrument/untitled_detector/flatfield_error'].attrs['EX_doc'] = '       *** Deprecated form.  Use plural form ***        Errors of the flat field correction data.  If provided, it is recommended        that it be compressed.      '
root['/untitled_entry/untitled_instrument/untitled_detector/flatfield_errors'].attrs['EX_doc'] = '       Errors of the flat field correction data.  If provided, it is recommended        that it be compressed.      '
root['/untitled_entry/untitled_instrument/untitled_detector/pixel_mask_applied'].attrs['EX_doc'] = '       True when the pixel mask correction has been applied in the        electronics, false otherwise.      '
root['/untitled_entry/untitled_instrument/untitled_detector/pixel_mask'].attrs['EX_doc'] = '       The 32-bit pixel mask for the detector. Can be either one mask        for the whole dataset (i.e. an array with indices i, j) or        each frame can have its own mask (in which case it would be        an array with indices nP, i, j).         Contains a bit field for each pixel to signal dead,        blind, high or otherwise unwanted or undesirable pixels.        They have the following meaning:          * bit 0: gap (pixel with no sensor)         * bit 1: dead         * bit 2: under-responding         * bit 3: over-responding         * bit 4: noisy         * bit 5: -undefined-         * bit 6: pixel is part of a cluster of problematic pixels (bit set in addition to others)         * bit 7: -undefined-         * bit 8: user defined mask (e.g. around beamstop)         * bits 9-30: -undefined-         * bit 31: virtual pixel (corner pixel with interpolated value)         Normal data analysis software would not take pixels into account        when a bit in (mask & 0x0000FFFF) is set. Tag bit in the upper        two bytes would indicate special pixel properties that normally        would not be a sole reason to reject the intensity value (unless        lower bits are set.         If the full bit depths is not required, providing a        mask with fewer bits is permissible.         If needed, additional pixel masks can be specified by        including additional entries named pixel_mask_N, where        N is an integer. For example, a general bad pixel mask        could be specified in pixel_mask that indicates noisy        and dead pixels, and an additional pixel mask from        experiment-specific shadowing could be specified in        pixel_mask_2. The cumulative mask is the bitwise OR        of pixel_mask and any pixel_mask_N entries.         If provided, it is recommended that it be compressed.      '
root['/untitled_entry/untitled_instrument/untitled_detector/countrate_correction_applied'].attrs['EX_doc'] = '       True when a count-rate correction has already been applied in        the data recorded here, false otherwise.      '
root['/untitled_entry/untitled_instrument/untitled_detector/bit_depth_readout'].attrs['EX_doc'] = '       How many bits the electronics record per pixel.      '
root['/untitled_entry/untitled_instrument/untitled_detector/detector_readout_time'].attrs['EX_doc'] = '       Time it takes to read the detector (typically milliseconds).        This is important to know for time resolved experiments.      '
root['/untitled_entry/untitled_instrument/untitled_detector/frame_time'].attrs['EX_doc'] = '       This is time for each frame. This is exposure_time + readout        time.      '
root['/untitled_entry/untitled_instrument/untitled_detector/gain_setting'].attrs['EX_doc'] = '       The gain setting of the detector. This influences background.      '
root['/untitled_entry/untitled_instrument/untitled_detector/saturation_value'].attrs['EX_doc'] = '       The value at which the detector goes into saturation.        Data above this value is known to be invalid.         For example, given a saturation_value and an underload_value,        the valid pixels are those less than or equal to the        saturation_value and greater than or equal to the underload_value.      '
root['/untitled_entry/untitled_instrument/untitled_detector/underload_value'].attrs['EX_doc'] = '       The lowest value at which pixels for this detector        would be reasonably be measured.         For example, given a saturation_value and an underload_value,        the valid pixels are those less than or equal to the        saturation_value and greater than or equal to the underload_value.      '
root['/untitled_entry/untitled_instrument/untitled_detector/sensor_material'].attrs['EX_doc'] = '       At times, radiation is not directly sensed by the detector.        Rather, the detector might sense the output from some        converter like a scintillator.        This is the name of this converter material.      '
root['/untitled_entry/untitled_instrument/untitled_detector/sensor_thickness'].attrs['EX_doc'] = '       At times, radiation is not directly sensed by the detector.        Rather, the detector might sense the output from some        converter like a scintillator. This is the thickness of this        converter material.      '
root['/untitled_entry/untitled_instrument/untitled_detector/threshold_energy'].attrs['EX_doc'] = '       Single photon counter detectors can be adjusted for a certain        energy range in which they work optimally. This is the energy        setting for this.  If the detector supports multiple thresholds,        this is an array.      '
root['/untitled_entry/untitled_instrument/untitled_detector/type'].attrs['EX_doc'] = '       Description of type such as scintillator,        ccd, pixel, image        plate, CMOS, ...      '
root['/untitled_entry/untitled_instrument/untitled_beam/incident_wavelength'].attrs['EX_doc'] = '       In the case of a monchromatic beam this is the scalar        wavelength.         Several other use cases are permitted, depending on the        presence or absence of other incident_wavelength_X        fields.         In the case of a polychromatic beam this is an array of        length **m** of wavelengths, with the relative weights        in ``incident_wavelength_weights``.         In the case of a monochromatic beam that varies shot-        to-shot, this is an array of wavelengths, one for each        recorded shot. Here, ``incident_wavelength_weights`` and        incident_wavelength_spread are not set.         In the case of a polychromatic beam that varies shot-to-        shot, this is an array of length **m** with the relative        weights in ``incident_wavelength_weights`` as a 2D array.         In the case of a polychromatic beam that varies shot-to-        shot and where the channels also vary, this is a 2D array        of dimensions **nP** by **m** (slow to fast) with the        relative weights in ``incident_wavelength_weights`` as a 2D        array.         Note, :ref:`variants <Design-Variants>` are a good way        to represent several of these use cases in a single dataset,        e.g. if a calibrated, single-value wavelength value is        available along with the original spectrum from which it        was calibrated.      '
root['/untitled_entry/untitled_instrument/untitled_beam/incident_wavelength_weight'].attrs['EX_doc'] = '       In the case of a polychromatic beam this is an array of        length **m** of the relative weights of the corresponding        wavelengths in incident_wavelength.         In the case of a polychromatic beam that varies shot-to-        shot, this is a 2D array of dimensions **nP** by **m**        (slow to fast) of the relative weights of the        corresponding wavelengths in incident_wavelength.      '
